import './App.css';
import Contact from './Contact';
import Navigationbar from './Navigationbar';
import { Routes, Route } from 'react-router-dom';
import Home from './Home';



function App() {
  return (
    <div>
    <Navigationbar />
    <Routes >
      <Route path="/" element={<Home />} />


    </Routes>
    </div>
  );
}

export default App;
